# 簡易心理聊天機器人（以 Regular Expression 實作）
import re
count = 0

flag = True
while flag == True:
    s = input()
    if s == "881":
        flag = False
    if flag == False:
        print("See you next time!")
        break

    m = re.search(pattern = 'my .*', string = s)
    n = re.search(pattern = "I'm .*", string = s)
    if m:
        s = re.sub(pattern = 'my',  repl = 'YOUR', string = m.group())
        s = re.sub(pattern =' me ', repl =' YOU ', string = s)
        print(s.upper())
    elif n:
        s = re.sub(pattern = "I'm", repl = 'YOU ARE', string = n.group(0))
        print('I AM SORRY TO HEAR ' + s.upper())
    elif count % 2 == 0:
        print('IN WHAT WAY?')
        count = count + 1
    elif count % 2 == 1:
        print('CAN YOU THINK OF A SPECIFIC EXAMPLE?')
        count = count + 1
